    { "rating": "3", "userId": 2, "updated": { "$date": 1245178608000 }, "body": "have you ever driven past &quot;slaughterhouse 5&quot;?  it's the acres of cows you see/smell while driving the 5 through the central california valley.  well, those cows have a namesake: Harris Ranch.  and HR has a dining room and bar for you to try.  the menu is -- surprise -- steak-heavy.  service was ok, the uniforms ill-fitting.  there's a bar.  and a lot of old people.  there's a gift shop.  and the building is great.  there are some really over-the-top chairs and other furnishings around if you look.  next time you're bored on the 5, give this place a shot.", "id": 381 }
