    { "rating": "4", "userId": 2, "updated": { "$date": 1247166464000 }, "body": "With such a pedigree it's no surprise this restaurant brings the goods.  Be glad they didn't try to get the name out before opening because you'll be waiting for a table more than likely.  There's a bar while you wait, and they know from cocktails.  The food is outstanding, entrees and smaller plates alike.  Go with a group so you can order a bunch of sides and get a good taste.  It's meatilicious!  They love food so much the place doubles as a butcher shop.", "id": 394 }
