    { "rating": "2", "userId": 2, "updated": { "$date": 1248811586000 }, "body": "Candy, just as the name and the cheezy logo might tell you, is a bit suburban-sophistication in feel.  it's got the interior of a large, freshly opened sports bar, the wood floors/accents, the black chairs, the booths with computer screens, the bottles of booze lined up for looks.  but there's a bit of a diamond in this rough.  i'm talking about huge 6 dollar pizzas at lunch.  and the pizza is damn good.  and the place is empty.  and the service is great.  get a bowl of the fried string beans and you've got a cheap meal that will feed 2 to 3 folks.  the place is empty at lunch so it's a quick in and out.  i want to try the place for happy hour some time.  but i'm scared to go there in the evening for what might be a pearl/frat magnet.", "id": 403 }
