    { "rating": "2", "userId": 2, "updated": { "$date": 1250216166000 }, "body": "Standard breakfast fare, tilting toward the mexican influenced dishes (breakfast burro -- big as a fucking newborn -- juevos rancheros).  ingredients and preparation go beyond average in most dishes, but you'll have to wait a lot longer for it -- there's a time warp between when your order is taken and it is served.  they have liquor and the short cocktail menu is loaded with damn good desayunal drinks.  friendly enough staff.  there are often very young kids working here, not unlike when the location was gramma lucy's.  apparently the breakfast sandwich is a good deal and i think they have an early bird special.", "id": 408 }
