    { "rating": "3", "userId": 2, "updated": { "$date": 1250216781000 }, "body": "HUB isn't new anymore, and i'm not sure why i haven't added this location yet.  in any case, this place is a nice spot to drop in, grab a bite and have a tasty beer.  greeat staff and owners.  the interior is well-designed with a nod to the cyclists in PDX.  the location is a bit unsweet for non-motorists.  food is on the better side of pup grub but not something to go out of your way for.  recently there was art on the walls done by the employees and it was damn good!  grab a growler on your way home: this is some of the best beer brewed in town.", "id": 409 }
