    { "rating": "3", "userId": 2, "updated": { "$date": 1242768596000 }, "body": "this &quot;spice trail&quot; (read: indian) restaurant in the lower clinton area delivers complexly tasty food.  the high ceilings with walls of windows feels intimate somehow.  staff was fairly attentive and very friendly.  my server seemed fascinated by me, possibly due to my lack of hygiene.  samosas were awesome and my chicken dish was superb.  will need to try the counter to suss it out more, but i'd go back.  update: been receiving twitters that lead me to believe happy hour at the counter here would be a good idea.", "id": 88 }
