    { "rating": "4", "userId": 2, "updated": { "$date": 1242768023000 }, "body": "finally made it to pok pok/whiskey soda lounge and i can't believe i waited this long -- well, except that i hate waiting...  should have known they would have a symbiotic relationship with Matchbox bar across the street.  the wait was about 30 minutes but we were able to drink and get a phone call when table was ready.  i was pretty much hammered by the end of the meal -- left my phone there, even -- so i don't remember particular plates, but i remember being wowed with dish after dish.  went with some Seattle/NYC foodie friends and they were jealous.  the service was superb, the super nice fellow helped us order great dishes and drinks.  we all left with that convivial glow that you wish could last forever.  went back the next day for my phone and a gracious Andy Ricker said he found it and gave it back to me.  class, that place.", "id": 89 }
