    { "rating": "4", "userId": 2, "updated": { "$date": 1260393881000 }, "body": "got to eat at this portland institution of nearly 40 years at long last.  definitely a &quot;don't judge a book by its cover&quot; exterior, the interior is intimate and warm.  a fixed price, 5 course meal was served, everything was wonderful: oyster with sorbet, pumpkin soup with bacon!  pasta dish, tuna, and a pork tenderloin that was ridiculous.  with nice wine and stellar desert.  anyway, it'll be closed after 11/22/08, so if you didn't get a chance, it's a shame.  though you're also $200 richer than i am.", "id": 125 },
    { "rating": "4", "userId": 2, "updated": { "$date": 1260393858000 }, "body": "Newly Reopened!  \nWhile visiting the bar next door we peeked into the newly remodeled dining room.  It's nicely appointed, with much more comfortable chairs.  it's still formal and gracious, but it's nice to have the windows.  maybe slightly less formal, more portland-friendly.  they've moved from a 7 course to a 5 course fixed price, i believe about $55.  i am looking forward to checking it out again.  ", "id": 443 }
