    { "rating": "2", "userId": 2, "updated": { "$date": 1248128226000 }, "body": "this new spot is ok in my book.  it took over the Nocturnal (RIP).  but they have done some things right.  the food: ok.  the staff: friendly as hell.  the space: the upstairs is trying to be a restaurant and a bar at the same time.  while we were there a couple guys came in, set up, and started playing music.  ok.  and we were the only diners on a wednesday.  but!  they have so much going for them.  the bar upstairs is full-on, nice barkeep, comfy space, people watching when they come.  there's a patiio that has some fun ammenities like swing seats and heaters and a cover.  there was a lot of thought put into the place.  i almost feel bad it's not quite right.  the not right: the prices are still high for having no reputation.\r\n\r\nok.  the downstairs.  they re-opened the bar.  it's still got the quirkiness that made us love the nocturnal.  skee ball machines, a slot-car race track, trivial pursuit boxes on every table.  \r\n\r\nthis place has it all.  except that indescribable it.  which its patrons need to bring.  seeing that it's right in the center of expanding burnside scenes, if it can hang around a while, it might turn out to be a great spot.  i will go back.", "id": 155 }
