    { "rating": "1", "userId": 7, "updated": { "$date": 1238105138000 }, "body": "The service and the food leave little to be desired. We were rushed through our meal at 6:00 on Sunday and the restaurant was half empty. I've been to ShunLee East and it's far superior. Go there instead or even the cafe, which has a slightly different menu, but still plenty of choices. It was a true disappointment. Don't waste your time.", "id": 333 }
