    { "rating": "3", "userId": 2, "updated": { "$date": 1238611156000 }, "body": "don't let the incredibly ghetto food cart fool you, this guy makes some outstanding vegetarian offerings.  part of portland's &quot;street food&quot; set, Dreamer's is a little green tow-along with constant jam-band music blaring from within.  the hippie fellow that makes your food is all smiles.  the buffalo tofu wrap is amazing and could feed two.  add fries (also amazing) and you get away for under 7 bucks.  just be prepared to wait for a bit, all food is cooked to order.", "id": 335 }
