    { "rating": "3", "userId": 2, "updated": { "$date": 1242768476000 }, "body": "the atmosphere is slightly subdued, but the service is upbeat and welcoming.  you're dining in the front room of a remodeled craftsman beautifully restored.  adventurous northwest food combinations are great and can be shared happily.  great drinks, too.  will be going back, especially to give happy hour a shot.", "id": 341 },
    { "rating": "4", "userId": 7, "updated": { "$date": 1242341477000 }, "body": "I tried it last night and really dug the ambience. The food was interesting and good. Lots of local fresh ingredients. Since there are smaller portions of the main dishes you can share a few and a get a real sense of the menu. I felt comfortably full when I left and extremely satisfied. The homemade beet salt and triple chocolate sorbetto are the goods.", "id": 349 }
