    { "rating": "3", "userId": 2, "updated": { "$date": 1259043518000 }, "body": "This classic, and quite truly, hole-in-the wall has a good group of young regulars.  and not the shitbag marina douches one might expect.  the place is about 6 feet wide, a counter just wide enough to set a beer on and about 8 stools.  behind the bar is a bathtub; half of it is filled with unopened beer on ice, the other half is for empties.  no liquor.  nothing on tap.  Scott was bartending the day we stopped in and he treated us well.  first off, we did about five &quot;Scottguns&quot; in the two hours there: we literally shotgunned beers (PBR), which Scott opened like a pro with a key from his pocked.  And Scott did one each time with us.  fuck yes!  place rules.", "id": 434 }
