    { "rating": "3", "userId": 2, "updated": { "$date": 1259043759000 }, "body": "the cocktail revolution was in full swing here well before the current trend we're going through now.  daily, the bartenders come in with fresh herbs/citrus/fruit, etc.. and make up new drinks on the fly.  there's a clubby feel sometimes, and it can take a while to get a drink, but you'll be happy when you get it.  the location is superb for people watching and meet-ups.  the decor is great, too.", "id": 435 }
