    { "rating": "2", "userId": 2, "updated": { "$date": 1259627186000 }, "body": "This is one of the many diners strewn around union square area that are open late.  that might be the only reason to try them out.  that's why i was here.  Daily Grill was closed.  I should have tried one of the dirtier, more authentic looking spots but wasn't in the mood.  food here wasn't anything horrible, but the staff was all hanging out in a booth drinking.  the one gal who did help me was nice enough.  everyone here seemed to be russian.", "id": 439 }
