    { "rating": "4", "userId": 2, "updated": { "$date": 1267477155000 }, "body": "I really liked this dinner spot in the theatre district.  it's Italian with a bunch of deli-like side dishes to choose from.  great service, nice atmosphere and decor, good food.  it felt very convivial and engaging.  we got a bunch of salad and pasta side dishes and a nice piece of fish.  our table was covered with plates and glasses and we happily shared all.\r\n", "id": 463 }
