    { "rating": "3", "userId": 2, "updated": { "$date": 1267482981000 }, "body": "Very cheesy, but still a good spot to check out if you've got spare time and are hungry.  another resorty feeling spot, you can watch an awesome sunset like we did from the island dock.  The service was friendly, but they lost their attention and one in our party felt the brunt of a complicated order going bad.  on the spendy side for its caliber, this is just another place &quot;to do.&quot;  there's the requisite burning man fire spinner and beat-machine-fueled guitarist/singer going through island-proper covers.\r\n\r\n", "id": 475 }
