    { "rating": "3", "userId": 2, "updated": { "$date": 1267484108000 }, "body": "Cheesy but who cares.  This open air tiki bar is right on the water with sand floors and thatched roofs.  The bartenders are not very good, but that's not a problem early in the day where there's no one there.  it's a nice place to waste a few hours and get some really sweet tropical drinks.", "id": 476 }
