    { "rating": "4", "userId": 2, "updated": { "$date": 1271887996000 }, "body": "It's a wonder i haven't been here before now.  This place is wonderful.  In an unassuming industrial location, part of the newly renovated Olympic Mills building, Olympic Provisions is &quot;Oregon's first USDA certified meat-curing facility.&quot;  it's like a european counter/deli style restaurant.  the wait staff is great and the food preps are helpful and in good moods.  the food is spectacular and a great beer selection.  it's a must", "id": 480 }
