    { "rating": "3", "userId": 2, "updated": { "$date": 1276033120000 }, "body": "Somehow this place was exactly as i had imagined it.  which was a good thing indeed.  the atmosphere is warm and welcoming.  the service is professional and attentive.  the night we went the menu was slightly Southern in bent and they did a good job on the dishes.  plenty of tasty starters and entreees to choose from.  there are some interesting specialty cocktails listed and the bartenders mix with care and skill.\r\n\r\nthe bar was the perfect place for a casual dinner with small group of us.  there were plenty of single professionals having a post-work dinner/drink.  this could be a Go To if i worked in the area.  \r\n\r\nthe prices are fairly steep but that might just be my Portland side talking.  drinks ~ $12; starters ~ $14; entrees ~ $28;\r\n\r\n", "id": 492 }
