    { "rating": "4", "userId": 2, "updated": { "$date": 1275072507000 }, "body": "One of my favorite meals ever.  We stumbled into this place -- on an island in a park -- during the lunch hour and it was like entering a different dimension.  The pace slowed, people were all smiles, there was a raging fire in a huge fireplace, it was sparsely filled, but those there winking as if to say: &quot;ah, you've found it.  welcome.&quot;\r\n\r\nservice: impeccable.  we sat at the counter and had a server bring whatever was recommended.  a warm beet salad with goat cheese, this may be where the trend all started!  everything she brought was great.  and conversation was lively.  she had us tasting wines just for fun.  \r\n\r\nmagic", "id": 488 }
