    { "rating": "4", "userId": 2, "updated": { "$date": 1291687071000 }, "body": "Kinda on the spendy side, but what's not these days.  We were hungry and the concierge recommended this spot.  On a saturday at 6pm the place was empty, but by the time we finished it was packed.  it's a slick, new, well-appointed but comfortable atmosphere with helpful staff and interesting items on the menu.  sorta a blast-from-the-past as the name might hint at.  the drinks were also well-done and not run of the mill.\r\n\r\na definite place to check out.", "id": 516 }
