    { "rating": "4", "userId": 2, "updated": { "$date": 1295594445000 }, "body": "One of the bars in this well-appointed section of the City Center development.  This bar, with its white starkness and classic design has a good vibe.  The service and drinks were not quite as good here, but it's a comfortable place to sit and people watch.  A good stop if you're with a friend and want to chat.  I wouldn't mind having this be my hotel bar at all.", "id": 521 }
