    { "rating": "5", "userId": 2, "updated": { "$date": 1295594681000 }, "body": "This place made me enjoy Vegas again.  Vegas kind of grew up a bit over the many years since i'd visited.  Now there are great restaurants and hotels that aren't too disneyfied and plastic.  The Aria is gorgeous, with incredible details everywhere and not cheap ones.  There are a ton of bars sprinkled around the main floor.  The rooms are completely remote-controlled with awesome beds and bathrooms.  Highly recommended.  I would definitely look to stay in the City Center development next time i'm in vegas.", "id": 522 }
