    { "rating": "4", "userId": 2, "updated": { "$date": 1297580802000 }, "body": "A Portland institution where old and young come for a decent prime rib style meal or to hang out in the lounge and dance to good R'n'B.\r\n\r\nPlush booths, carpet, wrought iron and the metal blimp rolling around to serve fresh beef at your table. It's a blast from the past that won't break the bank. Try out, it just might go into regular rotation. \r\n\r\nJust make sure to wear the right shoes to dinner so you can cut a rug after they cut you a hunk of beef. You'll need the exercise! ", "id": 2036 }
